<div id="c" class="bar"></div>
<script>
window.setInterval(function() {
  document.getElementById("c").style.width = Number(document.getElementById("c").style.width.replace("px", "")) + 2;
}, 150)
//Assets
bg = document.getElementById("bg");
blood = document.getElementById("blood");
player = document.getElementById("player");
pig = document.getElementById("pig");
damage = document.getElementById("damage");
player_attack = document.getElementById("player_attack");
n=0;
 window.setInterval(function() {
  document.getElementById("txt").style.color = rainbow(Math.random()*30, Math.random()*60);
  }, 55);
  function rainbow(numOfSteps, step) {
    var r, g, b;
    var h = step / numOfSteps;
    var i = ~~(h * 6);
    var f = h * 6 - i;
    var q = 1 - f;
    switch(i % 6){
        case 0: r = 1; g = f; b = 0; break;
        case 1: r = q; g = 1; b = 0; break;
        case 2: r = 0; g = 1; b = f; break;
        case 3: r = 0; g = q; b = 1; break;
        case 4: r = f; g = 0; b = 1; break;
        case 5: r = 1; g = 0; b = q; break;
    }
    var c = "#" + ("00" + (~ ~(r * 255)).toString(16)).slice(-2) + ("00" + (~ ~(g * 255)).toString(16)).slice(-2) + ("00" + (~ ~(b * 255)).toString(16)).slice(-2);
    return (c);
}
function start() {
    document.getElementById("player").style.visibility = "visible";
    document.getElementById("w").style.visibility = "visible";
    document.getElementById("c").style.visibility = "visible";
    document.getElementById("c").style.backgroundColor = "red";
    document.getElementById("c").style.width = window.innerWidth;
    document.getElementById("c").style.position = "fixed";
    document.getElementById("c").style.left = "0px";
    document.getElementById("player_attack").style.visibility = "hidden";
    document.body.style.position = "fixed";
    document.getElementById("button").style.visibility = "hidden";
    document.getElementById("title").style.visibility = "hidden";
    document.getElementById("bg").style.visibility = "visible";
    document.getElementById("bg").style.width = "120%";
    document.getElementById("bg").style.height = "120%";
    document.getElementById("bg").style.position = "fixed";
    document.getElementById("bg").style.left = "-10%";
    document.getElementById("bg").style.top = "-10%";
    document.getElementById("rain").style.visibility = "visible";
    document.getElementById("rain").style.width = "120%";
    document.getElementById("rain").style.height = "120%";
    document.getElementById("rain").style.position = "fixed";
    document.getElementById("rain").style.zIndex = "3";
    document.getElementById("rain").style.left = "-10%";
    document.getElementById("rain").style.top = "-10%";
    document.getElementById("player").style.visibility = "visible";
    document.getElementById("player").style.position = "fixed";
    document.getElementById("player").style.zIndex = "2";
    document.getElementById("player").style.left = window.innerWidth/2+document.getElementById("pig").style.width-50;
    document.getElementById("player").style.height = window.innerHeight/2;
    document.getElementById("player").style.top = window.innerHeight - document.getElementById("player").height;
    document.getElementById("player_attack").style.position = "fixed";
    document.getElementById("player_attack").style.zIndex = "2";
    document.getElementById("player_attack").style.left = window.innerWidth/2+document.getElementById("pig").style.width-50;
    document.getElementById("player_attack").style.height = window.innerHeight/2;
    document.getElementById("player_attack").style.top = window.innerHeight - document.getElementById("player_attack").height;
    document.getElementById("pig").style.visibility = "visible";
    document.getElementById("pig").style.position = "fixed";
    document.getElementById("pig").style.zIndex = "0";
    document.getElementById("pig").style.left = window.innerWidth/2;
    document.getElementById("pig").style.top = "0%";
    document.getElementById("pig").style.height = window.innerHeight;
    attackHandler();
}
function win() {
  document.getElementById("c").style.visibility = "hidden";
  document.getElementById("w").style.visibility = "hidden";
  document.getElementById("pig").style.visibility = "hidden";
  document.getElementById("blood").style.visibility = "hidden";
  document.getElementById("player").style.visibility = "hidden";
  document.getElementById("player_attack").style.visibility = "hidden";
  document.getElementById("rain").style.visibility = "hidden";
  document.getElementById("bg").style.visibility = "hidden";
  document.getElementById("player").style.visibility = "hidden";
  document.getElementById("txt").style.visibility = "visible";
  document.getElementById("win").style.visibility = "visible";
  document.getElementById("win").style.width = "120%";
  document.getElementById("win").style.height = "120%";
  document.getElementById("win").style.position = "fixed";
  document.getElementById("win").style.zIndex = "4";
  document.getElementById("win").style.left = "-10%";
  document.getElementById("win").style.top = "-10%";
}
function attackHandler() {
    document.body.addEventListener("click", handleClick);
    
function handleClick() {
    if (Number(document.getElementById("c").style.width.replace("px", "")) <= 5) {
      document.body.removeEventListener("click", handleClick);
      win();
    }
    document.getElementById("c").style.width = Number(document.getElementById("c").style.width.replace("px", "")) - 3;
    document.getElementById("player").style.visibility = "hidden";
    document.getElementById("player_attack").style.visibility = "visible";
    window.setTimeout(function() {
    document.getElementById("player").style.visibility = "visible";
    document.getElementById("player_attack").style.visibility = "hidden";
    document.getElementById("damage").play();
    document.getElementById("blood").style.visibility = "visible";
    document.getElementById("blood").style.position = "fixed";
    document.getElementById("blood").style.zIndex = "1";
    document.getElementById("blood").style.left = "50%";
    document.getElementById("blood").style.top = "50%";
    document.getElementById("blood").style.width = "36%";
    document.getElementById("blood").style.height = "30%";
        window.setTimeout(function() {
            document.getElementById("blood").style.visibility = "hidden";
        }, 150)
    
}, 150)}

}
